import React from "react";
import Clock from "./clock";
import Header from "./header";
function Home() {
  return (
    <div className="homeRoot">
      <div className="wrap">
        <header className="main_header">
          <Clock></Clock>
          <Link to="/Mypage" className="main_nav">
            <img src="./img/nav.svg" alt="nav"></img>
          </Link>
          <Header></Header>
        </header>
      </div>
    </div>
  );
}

export default Home;
